            <script>
                $(function () {

                    var details = [];

                    $(""#add-product-detail"").on(""click"", function () {
                        details.push({
                            cantidad: $(""#qt-product-detail"").val(),
                            unidad: $(""#unit-product-detail"").val(),
                            producto: $(""#product-product-detail"").val(),
                            detalle: """"
